import React from 'react';
import EventCard from '../components/EventCard';
import './userdashboard.css';

const UserDashboard = () => {
  const events = [
    { id: 1, title: "Hackathon", description: "24hr coding challenge" },
    { id: 2, title: "Tech Talk", description: "Talk on AI & ML" },
    { id: 3, title: "Web Dev Bootcamp", description: "Build real-world projects" }
  ];

  return (
    <div className="user-dashboard">
      <h2 className="dashboard-heading">Available Events</h2>
      <div className="event-list">
        {events.map((event) => (
          <EventCard key={event.id} event={event} showRegisterButton />
        ))}
      </div>
    </div>
  );
};

export default UserDashboard;
